import React from 'react'
import { UserSearch, ClipboardPlus, BookPlus, CircleUser } from 'lucide-react';
import './nurseSide.css'

function NurseSide() {
    return (
        <div >
            <ul className='side1'>
                <li className='elm1'><UserSearch /> Patients</li><br />
                <li className='elm1'><ClipboardPlus /> Consultation</li><br />
                <li className='elm1'><BookPlus /> History of patients</li><br />
                <li className='elm1'><CircleUser /> Profile</li><br />
            </ul>
        </div>
    )
}

export default NurseSide
